// src/pages/AdminDashboard.js
import React, { useEffect, useState, useCallback } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import AdminNavbar from '../components/AdminNavbar';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('upload');
  const [mobiles, setMobiles] = useState([]);
  const [image, setImage] = useState(null);
  const [form, setForm] = useState({
    brand: '',
    model: '',
    ram: '',
    storage: '',
    price: '',
    condition: ''
  });

  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  const fetchMobiles = useCallback(async () => {
    try {
      const { data } = await axios.get('http://localhost:5000/api/mobiles', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(data);
    } catch (error) {
      console.error('❌ Failed to fetch mobiles:', error);
    }
  }, [token]);

  useEffect(() => {
    if (!token) {
      navigate('/login');
    } else {
      fetchMobiles();
    }
  }, [token, navigate, fetchMobiles]);

  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleUpload = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    Object.entries(form).forEach(([key, value]) => formData.append(key, value));
    formData.append('image', image);

    try {
      await axios.post('http://localhost:5000/api/mobiles/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`
        }
      });

      alert('✅ Mobile uploaded successfully!');
      setForm({ brand: '', model: '', ram: '', storage: '', price: '', condition: '' });
      setImage(null);
      fetchMobiles();
    } catch (error) {
      console.error('❌ Upload failed:', error);
      alert('Failed to upload mobile.');
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this mobile?')) return;

    try {
      await axios.delete(`http://localhost:5000/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(mobiles.filter((m) => m._id !== id));
    } catch (error) {
      console.error('❌ Delete failed:', error);
      alert('Failed to delete mobile.');
    }
  };

  return (
    <div className="admin-dashboard">
      <AdminNavbar activeTab={activeTab} setActiveTab={setActiveTab} />

      <div className="admin-content">
        {activeTab === 'upload' && (
          <form className="upload-form" onSubmit={handleUpload}>
            <h2>📤 Upload Mobile</h2>
            <input name="brand" type="text" placeholder="Brand" value={form.brand} onChange={handleInputChange} required />
            <input name="model" type="text" placeholder="Model" value={form.model} onChange={handleInputChange} required />
            <input name="ram" type="text" placeholder="RAM" value={form.ram} onChange={handleInputChange} required />
            <input name="storage" type="text" placeholder="Storage" value={form.storage} onChange={handleInputChange} required />
            <input name="price" type="number" placeholder="Price" value={form.price} onChange={handleInputChange} required />
            <input name="condition" type="text" placeholder="Condition" value={form.condition} onChange={handleInputChange} required />
            <input type="file" onChange={(e) => setImage(e.target.files[0])} required />
            <button type="submit">Upload</button>
          </form>
        )}

        {activeTab === 'manage' && (
          <div className="mobile-grid-container">
            <h2>📱 Manage Mobiles</h2>
            {mobiles.length === 0 ? (
              <p>No mobiles uploaded yet.</p>
            ) : (
              <div className="mobile-grid">
                {mobiles.map((mobile) => (
                  <div key={mobile._id} className="mobile-card-modern">
                    <div className="mobile-img-wrapper">
                      <img src={mobile.imageUrl} alt={mobile.model} />
                    </div>
                    <div className="mobile-info">
                      <h3>{mobile.brand} {mobile.model}</h3>
                      <p className="spec">{mobile.ram} / {mobile.storage}</p>
                      <p className="condition">{mobile.condition}</p>
                      <p className="price">₹{mobile.price}</p>
                      <button onClick={() => handleDelete(mobile._id)}>🗑 Delete</button>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        )}

      </div>
    </div>
  );
};

export default AdminDashboard;
